package interview_Programs;

public class FourW_Q1 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int no =2;
		int count=1;
		for (int i=1; i<=no; i++)
		{
			System.out.print(count+" ");
			count++;
		}
		
		
		
		for(int i=1; i<=no; i++)
		{
			System.out.print(count-1+" ");
			count--;
		}
	}

}



